/*Table structure for table `jy_users_login_log` */

DROP TABLE IF EXISTS `jy_users_login_log`;

CREATE TABLE `jy_users_login_log` (
  `Id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户登录信息',
  `playerid` bigint(20) NOT NULL COMMENT '用户ID',
  `UsersName` varchar(50) NOT NULL COMMENT '用户名称',
  `Gold` bigint(20) NOT NULL COMMENT '登录金币',
  `Diamond` bigint(20) NOT NULL COMMENT '登录钻石',
  `LastIP` varchar(50) NOT NULL COMMENT '登录IP',
  `Level` int(11) DEFAULT NULL COMMENT '玩家等级',
  `LastChannel` varchar(50) NOT NULL COMMENT '登录渠道',
  `RegChannel` varchar(50) NOT NULL COMMENT '注册渠道',
  `Version` varchar(50) DEFAULT NULL COMMENT '版本',
  `Platform` tinyint(1) NOT NULL DEFAULT '1' COMMENT '平台 1-苹果 2-安卓',
  `LastTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登录时间',
  `RegTime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  PRIMARY KEY (`Id`),
  KEY `playerid` (`playerid`,`LastTime`),
  KEY `Diamond` (`Diamond`,`LastIP`),
  KEY `LastTime` (`LastTime`)
) ENGINE=MyISAM AUTO_INCREMENT=2705 DEFAULT CHARSET=utf8;

